import {
  NavLink
} from 'react-router-dom';

function Top_Part() {

  const [isShown, setIsShown] = useState(false);
  //<header className="px-6 py-6 font-bold absolute-top text-2xl">CS IO</header>

//!isShown
  if (true){
    return (
      <div class="flex bg-orange-200" onMouseEnter={() => setIsShown(true)} onMouseLeave={() => setIsShown(false)}>
        <div className="flex relative justify-center content-center h-screen flex-wrap bg-orange-200">

            <div className="font-bold justify-center text-center py-6 text-6xl">We help students have their voices* heard.</div>
	</div>
    </div>
    );
}

  else {
    return (
      <div class="flex md:w-1/3 h-64 sm:w-1/6 rounded-lg justify-around shadow-lg my-3" onMouseEnter={() => setIsShown(true)}
      onMouseLeave={() => setIsShown(false)}>


    </div>
    );

  }
}

export default Top_Part;
